const data = collections['a1f8018b-001d-4803-b586-b5d5827ca4d3']?.['data'];
if (!data) return [];

// Reaproveitamos a l√≥gica das datas para garantir alinhamento
const labels = [...new Set(data.map(item => item.date))].sort();

// Prepara arrays de contagem
const safePageCounts = labels.map(date => 
  data.filter(item => item.date === date && item.block === true).length
);

const offerPageCounts = labels.map(date => 
  data.filter(item => item.date === date && item.block !== true).length
);

return [
  {
    label: 'P√°gina da Oferta',
    data: offerPageCounts,
    backgroundColor: '#10B981', // Verde Emerald (Sucesso)
    borderRadius: 4,
    stack: 'Stack 0', // Define que faz parte da mesma pilha
  },
  {
    label: 'P√°gina Segura',
    data: safePageCounts,
    backgroundColor: '#f5f5f5', // Vermelho Red (Bloqueio)
    borderRadius: 4,
    stack: 'Stack 0', // Mesma pilha = empilhado
  }
];
